import React from 'react';
import { Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button } from 'reactstrap';

const Card1 = (props) => {
  return (
    <div style={{border:"1px solid black",width:"fit-content",marginTop:"2em",justifyContent:"center"}}>
    <h1>{props.i.name}</h1>
    </div>
  );
};

export default Card1;
